import React from 'react';
import '../styles/Promotions.css';

const Promotions = () => {
  return (
    <div className="promotions">
      <h1>โปรโมชั่น</h1>
      <p>Welcome to the Promotions page!</p>
    </div>
  );
};

export default Promotions;
